      SELECT ALL COUNT ( * ) * 71 FROM tab1 (FORMAT parquet) WHERE ( + col0 ) NOT BETWEEN ( CAST ( NULL AS INTEGER ) ) AND - 97 * 56;
  - name: tab1

outputs:
  - name: q11945.out
    data: |
      213
